const AwicCodes: React.SFC<{}> = (props) => {
	const awicCodedTaxa: ScoringTaxonToPrint[] = awic.map((tx) => {
		const codedTaxon = Array.from(allTaxa.entries()) .find((testTx) => {
			if (tx.major_group) {
				return testTx[1].major_group === tx.major_group;
			} 
			else if (tx.family) {
				return testTx[1].family === tx.family;
			}
			else {
				return testTx[1].species === tx.species &&
					testTx[1].genus.split(' ')[0] === tx.genus;
			}
		}) as [TaxonCode, Taxa]

		let name = '';
		if (tx.major_group) { name += tx.major_group + ' '; }
		if (tx.family)      { name += tx.family      + ' '; }
		name += tx.genus + ' ' + tx.species;

		const info     = codedTaxon[1];
		const codeName = `${info.major_group} ${info.family} ${info.genus} ${info.species}`;
		const scoreStr = `score:${tx.score}`;

		return { scoreStr, name, code: codedTaxon[0], codeName };
	})

	return printTaxa('AWIC', awicCodedTaxa);
}


const BmwpCodes: React.SFC<{}> = () => {
	const bmwpCodedTaxa: ScoringTaxonToPrint[] = bmwp.map((taxon) => {
		const tx = Array.from(allTaxa.entries()) .find((testTx) => {
			return testTx[1].family === taxon.family
				|| testTx[1].major_group === taxon.family;
		}) as [TaxonCode, Taxa]

		const name     = taxon.family;
		const info     = tx[1];
		const codeName = `${info.major_group} ${info.family} ${info.genus} ${info.species}`;
		const scoreStr = `score_orig:${taxon.score_orig}, ` +
						 `score_rev:${taxon.score_rev}, ` +
						 `score_riffle:${taxon.score_riffle}, ` +
						 `score_riffle_pool:${taxon.score_riffle_pool}, ` +
						 `score_pool:${taxon.score_pool}`;

		return { scoreStr, name, code: tx[0], codeName };
	})

	return printTaxa('BMWP', bmwpCodedTaxa);
}


let hasErrs:boolean = false;

const CciCodes: React.SFC<{}> = () => {
	const errs:any = [];
	const cciCodedTaxa: ScoringTaxonToPrint[] = cci.map((taxon) => {
		const tx = Array.from(allTaxa.entries()) .find((testTx) => {
			return (testTx[1].genus === taxon.genus
			        || testTx[1].genus.split(' ')[0] === taxon.genus.split('_')[0])
				&& testTx[1].species === taxon.species;
		}) as [TaxonCode, Taxa]

		// TEMP, TODO: delete
		if (tx === undefined) {
			hasErrs = true;
			errs.push(taxon);
			return { code: '', codeName: '', name: '', scoreStr: '', }
		}

		const name     = taxon.major_group + ' ' + taxon.family + ' ' + taxon.genus + ' ' + taxon.species;
		const info     = tx[1];
		const codeName = `${info.major_group} ${info.family} ${info.genus} ${info.species}`;
		const scoreStr = `score:${taxon.score}`;

		return { scoreStr, name, code: tx[0], codeName };
	})

	return (<div>
		<h2>CCI errors</h2>
		{errs.map((err:any) => (<div>{err.major_group} {err.family} {err.genus} {err.species} - {err.score}</div>))}
		{printTaxa('CCI', cciCodedTaxa)}
	</div>)
}


const DehliCodes: React.SFC<{}> = () => {
	const errs:any = [];
	const dehliCodedTaxa: ScoringTaxonToPrint[] = dehli.map((taxon) => {
		const tx = Array.from(allTaxa.entries()) .find((testTx) => {
			return (testTx[1][taxon.by] === taxon.taxon ||
					testTx[1][taxon.by].split(' ')[0] === taxon.taxon.split('_')[0]);
		}) as [TaxonCode, Taxa]

		// TEMP, TODO: delete
		if (tx === undefined) {
			hasErrs = true;
			errs.push(taxon);
			return { code: '', codeName: '', name: '', scoreStr: '', }
		}

		const name     = taxon.by + ': ' + taxon.taxon;
		const info     = tx[1];
		const codeName = `${info.major_group} ${info.family} ${info.genus} ${info.species}`;
		const scoreStr = `score:${taxon.score}`;

		return { scoreStr, name, code: tx[0], codeName };
	})

	return (<div>
		<h2>DEHLI errors</h2>
		{errs.map((err:any) => (<div>{err.by + ': ' + err.taxon}</div>))}
		{printTaxa('DEHLI', dehliCodedTaxa)}
	</div>)
}


